import React from 'react';
import axios from 'axios';

class AdminRegister extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      formData: {
        username: '',
        email: '',
        password: ''
      }
    };
  }

  handleChange = (event) => {
    const { name, value } = event.target;
    this.setState({
      formData: {
        ...this.state.formData,
        [name]: value
      }
    });
  };

  handleSubmit = async (event) => {
    event.preventDefault();
    const { formData } = this.state;

    try {
      const response = await axios.post('/admin/register', formData);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  render() {
    const { formData } = this.state;

    return (
      <>
        <div className="container">
          <div className="login-form">
            <h1> Register New Admin </h1>
            <form onSubmit={this.handleSubmit}>
              <input type="text" name="username" placeholder="Username" onChange={this.handleChange} value={formData.username} />
              <input type="text" name="email" placeholder="Email" onChange={this.handleChange} value={formData.email} />
              <input type="text" name="password" placeholder="Password" onChange={this.handleChange} value={formData.password} />
              <button type="submit">Register</button>
            </form>
          </div>
        </div>
      </>
    );
  }
}

export default AdminRegister;
